import React, { useState} from "react";

import "./LeftPart.css";
export const LeftPart: React.FC = () => {
  const [count, setCount] = useState(0);
  console.log(count)
  return <div className="left-part" onClick={() => setCount(count + 1)}>left part</div>;
};
